      return data.map((phone)=>{
        return <div className='col-4'>
          <SanPhamRedux phone={phone}></SanPhamRedux>
        </div>
      })
  }
  return (
    <div className='row'>
      <div className="col-4">
        {renderSanPham}
      </div>

    </div>
  )
}

